            //         useNavigate(`/verify/${res.request_id}`)
            //     }
            // });
        }




const Register = () => {
        return (
                    <Form  
                        fields={registerFields} 
                        onSubmit={onRegisterSubmit} 
                        buttonLabel={"Register"} 
                        linkTo={"/verify"} 
                        apiResponse={this.state.registerResponse}
                    />
        )
}

export default Register

